import React, { Component } from "react";
import Parks from "./data/parks.json";

class Home extends Component {
  render() {
    return (
      <div>
        <h1>This is the homepage!</h1>
        <p>See all of the wildlife here!</p>
      </div>
    );
  }
}

export default Home;
